import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="container-fluid p-0">
    <nav className="navbar navbar-expand-md navbar-dark bg-dark">
    <a className="navbar-brand" href="#"><i class="fas fa-dolly"></i>&nbsp;Rapid Transport&nbsp;</a>

    <div className="navbar-nav ml-auto">   
      <a className="navbar-nav-link" href="#">&nbsp;Quem Somos &nbsp;</a>
      <a className="navbar-nav-link" href="#">&nbsp;Fale Conosco &nbsp;</a>
      <a className="navbar-nav-link" href="#">&nbsp;Trabalhe Conosco &nbsp;</a>
      </div>
      </nav> 



      <footer className="container col-12 d-flex pt-3 justify-content-around footer bg-dark text-light text-center">

      <i class="fab fa-facebook-square"></i>
      <i class="fab fa-linkedin"></i>
      <i class="fab fa-instagram"></i>
      <i class="fab fa-twitter-square"></i>

</footer>

    </div>
  );
}

export default App;
